import React from 'react';

const Home = () => {
  return (
    <div className="home">
      <div className="home-content">
        <h1>Welcome to my portfolio!</h1>
        <p>As a fresh graduate student in Computer Science, I am excited to showcase my journey, projects, and creativity. Crafting this website has been a labor of love, and I can't wait to share it with you!</p>
        <button className="btn">Check my projects</button>
      </div>
      <div className="contact-info">
        <div style={{
                    display: "flex",
                    flexWrap: "wrap",
                    justifyContent: "space-between",
                    margin: "3%",
                }}>
          <h2>Address:</h2>
          <p>Melbourne VIC 3000</p></div>

          <div style={{
                    display: "flex",
                    flexWrap: "wrap",
                    justifyContent: "space-between",
                    margin: "3%",
                }}>
          <h2>Phone:</h2>
          <p>0420864595</p></div>


          <div style={{
                    display: "flex",
                    flexWrap: "wrap",
                    justifyContent: "space-between",
                    margin: "3%",
                }}>
          <h2>Email:</h2>
          <p>myattheingi.810@gmail.com</p>
          </div>
      </div>
    </div>
  );
};

export default Home;
